import "./estilo.css";
import Logo from "../logo";
import HeaderOptions from "../headerOptions";
import HeaderIcons from "../headerIcons";

function Header(){
    return (
        <header className='appHeader'>
            <Logo/>
            <HeaderOptions/>
            <HeaderIcons/>
        </header>
    );
}

export default Header;
